	static int calc(String a, String b) {
		int n = a.length();
		int m = b.length();
		for(int i = 0; i < Math.min(n, m); i++) {
			if(!a.substring(0, i).equals(b.substring(0, i))) {
				return n + m - 2*i;
			}
		}
		return 0;
	}
	
